def findRestaurant(list1, list2):
    shortArr = min(list1, list2)
    longArr = max(list1, list2)
    dict1 = {}
    result = []
    temp = len(list1) + len(list2)
    for i, value in enumerate(longArr):
        dict1[value] = i
    for i, value in enumerate(shortArr):
        if (value in dict1):
            if (i + dict1[value]) < temp:
                temp = i + dict1[value]
                result = [value]
            elif (i + dict1[value]) == temp:
                result.append(value)

    print(result)
    return result


